import './App.css';
import {BrowserRouter, Switch, Route, Redirect, useParams} from "react-router-dom";
import whiskey from './imgs/whiskey.jpg'
import duke from './imgs/duke.jpg'
import perry from './imgs/perry.jpg'
import tubby from './imgs/tubby.jpg'

import Thumbnail from './Thumbnail';
import DogDetails from './DogDetails';

App.defaultProps = {
  dogs: [
    {
      name: "Whiskey",
      age: 5,
      src: whiskey,
      facts: [
        "Whiskey loves eating popcorn.",
        "Whiskey is a terrible guard dog.",
        "Whiskey wants to cuddle with you!"
      ]
    },
    {
      name: "Duke",
      age: 3,
      src: duke,
      facts: [
        "Duke believes that ball is life.",
        "Duke likes snow.",
        "Duke enjoys pawing other dogs."
      ]
    },
    {
      name: "Perry",
      age: 4,
      src: perry,
      facts: [
        "Perry loves all humans.",
        "Perry demolishes all snacks.",
        "Perry hates the rain."
      ]
    },
    {
      name: "Tubby",
      age: 4,
      src: tubby,
      facts: [
        "Tubby is really stupid.",
        "Tubby does not like walks.",
        "Angelina used to hate Tubby, but claims not to anymore."
      ]
    }
  ]
}

function App() {
  return (
    <div className="App">
      <div className='App__Heading'>
        <h1>Welcome to the Dog Kennel!</h1>
      </div>
      <div className='App__Body'>
        <Thumbnail name={App.defaultProps.dogs[0].name} img={whiskey}/>
        <Thumbnail name={App.defaultProps.dogs[1].name} img={duke}/>
        <Thumbnail name={App.defaultProps.dogs[2].name} img={perry}/>
        <Thumbnail name={App.defaultProps.dogs[3].name} img={tubby}/>

      </div>


    </div>
  );
}

function Router() {
  return (
    <BrowserRouter>
        <Switch>
          <Route path="/dogs"> <App /> </Route>
          <Route path="/dogs/:name"> <DogDetails /> </Route>
          <Redirect to="/dogs"/>
        </Switch>
      </BrowserRouter>

  )
}

export {App, Router};
